import React from 'react';
import ImageUpload from './FormComponents/ImageUpload';
import DiscountToKeep from './FormComponents/DiscountToKeep';
import ItemAmount from './FormComponents/ItemAmount';
import NarvarReturn from './FormComponents/NarvarReturn';
import RefundAmount from './FormComponents/RefundAmount';


const LevelOneForm = () => {
    const [select, setSelect] = useState<null | string>('');
    const handleSelection = (event:FormEvent<HTMLDivElement>) => {
        const el = event.target as HTMLDivElement
        const id = el.getAttribute('id');
        console.log(id)
        setSelect(id);
    }
    return (
        <div>
            <h2>Level One</h2>
            <ImageUpload />
            <DiscountToKeep onChange={handleSelection}/>
            <RefundAmount />
            <NarvarReturn />
        </div>
    )
}

export default LevelOneForm;
